     5→import { EventEmitter } from 'node:events';
     6→import type { ExecutionResponse, SessionOptions, SendOptions, ClaudeExecutionOptions } from '../../types/index.js';
     7→import type { ClaudeAdapter } from './index';
     8→import { createSessionMessageLogPath } from '../../utils/index.js';
     9→
    10→/**
    11→ * Claude session for multi-turn conversations
    12→ */
    13→export class ClaudeSession extends EventEmitter {
    14→  private adapter: ClaudeAdapter;
    15→  private options: SessionOptions;
    16→  private _sessionId?: string;
    17→  private _messageCount = 0;
    18→  private _aborted = false;
    19→  readonly startedAt: number;
    20→  lastMessageAt?: number;
    21→
    22→  constructor(adapter: ClaudeAdapter, options: SessionOptions = {}) {
    23→    super();
    24→    this.adapter = adapter;
    25→    this.options = options;
    26→    this.startedAt = Date.now();
    27→
    28→    // Pre-set session ID if provided
    29→    if (options.sessionId) {
    30→      this._sessionId = options.sessionId;
    31→    }
    32→  }
    33→
    34→  /**
    35→   * Send a message in this session
    36→   */
    37→  async send<T = string>(message: string, options: SendOptions = {}): Promise<ExecutionResponse<T>> {
    38→    if (this._aborted) {
    39→      throw new Error('Cannot send message: session has been aborted');
    40→    }
    41→
    42→    // Increment message count
    43→    this._messageCount++;
    44→
    45→    // Merge session options with message options
