     5→import { describe, it, expect, vi, beforeEach } from 'vitest';
     6→import { EventEmitter } from 'node:events';
     7→import { Session } from '../../../src/client/session';
     8→import type { AIAdapter, ExecutionResponse } from '../../../src/types/index';
     9→
    10→// Mock adapter session
    11→class MockAdapterSession extends EventEmitter {
    12→  private _sessionId?: string;
    13→  private _messageCount = 0;
    14→
    15→  async send<T = string>(message: string, options?: any): Promise<ExecutionResponse<T>> {
    16→    this._messageCount++;
    17→
    18→    if (!this._sessionId) {
    19→      this._sessionId = options?.sessionId || `mock-session-${Date.now()}`;
    20→    }
    21→
    22→    const response: ExecutionResponse<T> = {
    23→      output: `Response to: ${message}` as T,
    24→      sessionId: this._sessionId,
    25→      status: 'success',
    26→      exitCode: 0,
    27→      duration: 100,
    28→      metadata: {},
    29→    };
    30→
    31→    // Emit complete event asynchronously
    32→    setImmediate(() => this.emit('complete', response));
    33→
    34→    return response;
    35→  }
    36→
    37→  abort(): void {
    38→    this.emit('aborted');
    39→  }
    40→
    41→  getSessionId(): string | undefined {
    42→    return this._sessionId;
    43→  }
    44→
    45→  getMessageCount(): number {
    46→    return this._messageCount;
    47→  }
    48→}
    49→
    50→// Mock adapter
    51→const mockAdapter: AIAdapter = {
    52→  async execute() {
    53→    return {
    54→      output: 'test',
    55→      sessionId: 'test',
    56→      status: 'success',
    57→      exitCode: 0,
    58→      duration: 100,
    59→      metadata: {},
    60→    };
    61→  },
    62→  getCapabilities() {
    63→    return {
    64→      streaming: true,
    65→      sessionManagement: true,
    66→      toolCalling: true,
    67→      multiModal: false,
    68→    };
    69→  },
    70→};
    71→
    72→describe('Session', () => {
    73→  let adapterSession: MockAdapterSession;
    74→  let session: Session;
    75→
    76→  beforeEach(() => {
    77→    adapterSession = new MockAdapterSession();
    78→    session = new Session(mockAdapter, adapterSession, {});
    79→  });
    80→
    81→  describe('Initialization', () => {
    82→    it('should initialize with zero message count', () => {
    83→      expect(session.messageCount).toBe(0);
    84→      expect(session.getMessageCount()).toBe(0);
    85→    });
    86→
    87→    it('should not have session ID initially', () => {
    88→      expect(session.sessionId).toBeUndefined();
    89→      expect(session.getSessionId()).toBeUndefined();
    90→    });
    91→
    92→    it('should record start time', () => {
    93→      const beforeTime = Date.now();
    94→      const newSession = new Session(mockAdapter, new MockAdapterSession(), {});
    95→      const afterTime = Date.now();
    96→
    97→      expect(newSession.startedAt).toBeGreaterThanOrEqual(beforeTime);
    98→      expect(newSession.startedAt).toBeLessThanOrEqual(afterTime);
    99→    });
   100→
   101→    it('should accept pre-set session ID', () => {
   102→      const customSession = new Session(mockAdapter, new MockAdapterSession(), {
   103→        sessionId: 'custom-session-id',
   104→      });
   105→
   106→      expect(customSession.sessionId).toBe('custom-session-id');
   107→    });
   108→
   109→    it('should not have last message time initially', () => {
   110→      expect(session.lastMessageAt).toBeUndefined();
   111→    });
   112→  });
   113→
   114→  describe('Sending Messages', () => {
   115→    it('should send message and return response', async () => {
   116→      const result = await session.send('Hello');
   117→
   118→      expect(result.output).toBe('Response to: Hello');
   119→      expect(result.status).toBe('success');
   120→    });
   121→
   122→    it('should increment message count', async () => {
   123→      expect(session.messageCount).toBe(0);
   124→
   125→      await session.send('Message 1');
   126→      expect(session.messageCount).toBe(1);
   127→
   128→      await session.send('Message 2');
   129→      expect(session.messageCount).toBe(2);
   130→
   131→      await session.send('Message 3');
   132→      expect(session.messageCount).toBe(3);
   133→    });
   134→
   135→    it('should capture session ID from first message', async () => {
   136→      expect(session.sessionId).toBeUndefined();
   137→
   138→      const result = await session.send('First message');
   139→
   140→      expect(session.sessionId).toBeDefined();
   141→      expect(session.sessionId).toBe(result.sessionId);
   142→    });
