   144→    it('should maintain same session ID across messages', async () => {
   145→      const result1 = await session.send('Message 1');
   146→      const result2 = await session.send('Message 2');
   147→      const result3 = await session.send('Message 3');
   148→
   149→      expect(result1.sessionId).toBe(result2.sessionId);
   150→      expect(result2.sessionId).toBe(result3.sessionId);
   151→      expect(session.sessionId).toBe(result1.sessionId);
   152→    });
