   154→    it('should update last message time', async () => {
   155→      expect(session.lastMessageAt).toBeUndefined();
   156→
   157→      const beforeTime = Date.now();
   158→      await session.send('Message');
   159→      const afterTime = Date.now();
   160→
   161→      expect(session.lastMessageAt).toBeGreaterThanOrEqual(beforeTime);
   162→      expect(session.lastMessageAt).toBeLessThanOrEqual(afterTime);
   163→    });
   164→
   165→    it('should update last message time on each send', async () => {
   166→      await session.send('Message 1');
