   196→      );
   197→    });
   198→
   199→    it('should prioritize send options over session options', async () => {
   200→      const sessionWithOptions = new Session(mockAdapter, adapterSession, {
   201→        verbose: false,
   202→        logPath: '/default/logs',
   203→      });
   204→
   205→      const sendSpy = vi.spyOn(adapterSession, 'send');
   206→
   207→      await sessionWithOptions.send('Test', {
   208→        verbose: true,
   209→        logPath: '/override/logs',
