   211→
   212→      expect(sendSpy).toHaveBeenCalledWith(
   213→        'Test',
   214→        expect.objectContaining({
   215→          verbose: true,
   216→          logPath: '/override/logs',
   217→        })
   218→      );
   219→    });
   220→  });
   221→
   222→  describe('Abort', () => {
