   228→      expect(abortSpy).toHaveBeenCalled();
   229→    });
   230→
   231→    it('should emit aborted event via forwarding', () => {
   232→      return new Promise<void>((resolve) => {
   233→        session.on('aborted', () => {
   234→          resolve();
